import React, { Component } from 'react'
import { Input } from 'reactstrap'

class Question extends Component {

    constructor(props){
        super(props)
    }

    renderQuestion = ({ questionID, question }) => (
        <div>
            <h4>{question}</h4>
            <input type="radio" name={questionID} value="1" />
            <input type="radio" name={questionID} value="2" />
            <input type="radio" name={questionID} value="3" />
            <input type="radio" name={questionID} value="4" />
            <Input type="radio" name={questionID} value="5" />
        </div>)

    render() {
        const { questions } = this.props
        return (
            <div className="question">
                {questions.map(this.renderQuestion)}
            </div>
        )
    }
}

export default Question
